import React, { Component } from 'react';
import "./CustomerLogin.css"

class CustomerLogin extends Component {
    state = {  }
    render() { 
        return ( 
            <div className="container">
                <div class="card login-container">
                    <div class="two-container">
                        <img id="login-image" src="https://www.kkolias.com/wp-content/uploads/2011/11/FRUITmarket.jpg" className="card-img-left" alt=""/>
                        <div class="card-body login-body">
                            <h5 class="card-title">Login as a customer</h5>
                            <form action="">
                                <input type="text" id="username" name="username" className="form-control"/>
                                <input type="password" id="password" name="password" className="form-control"/>
                                <button type="submit" className="btn btn-primary btn-lg">Login</button>
                            </form>
                            <span>OR</span><br/>
                            <a href="" className="btn btn-success btn-lg">Register</a><br/>
                            <a href="" className="btn btn-secondary btn-lg">Not a customer? Click Here</a>
                        </div>
                    </div>
                </div>
            </div>
         );
    }
}
 
export default CustomerLogin;
